query:
/*+ NoMergeJoin(mc t) */ select count(*)
from movie_companies AS mc
inner join title AS t
on t.id = mc.movie_id AND mc.company_id > 419 AND mc.company_type_id > 1 AND t.kind_id < 7 AND t.production_year = 1979
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.person_id < 1372658 AND ci.role_id > 1;
